import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Form from 'react-bootstrap/Form';
import Offcanvas from 'react-bootstrap/Offcanvas';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import Tooltip from 'react-bootstrap/Tooltip';
import background from './Home.module.scss';
import aniStyle from './Animation.module.scss';
import menuStyle from './Menu.module.scss';
import Sun from './Sun';


import { useState } from 'react';




const Home = () => {



    return (
    <>
        <div id={background.star1}></div>
        <div id={background.star2}></div>
        <div id={background.star3}></div>
        <div id={background.star4}></div>
        {checked ? <div id={aniStyle.sun_animode}/>  : 
        <div onClick={toggleShow} className="me-2" id={menuStyle.sun_menumode}>
        </div>}
        <div id= {checked ? aniStyle.mercury_animode : menuStyle.mercury_menumode}></div>
        <div id= {checked ? aniStyle.venus_animode : menuStyle.venus_menumode}></div>
        <div id= {checked ? aniStyle.earth_animode : menuStyle.earth_menumode}></div>
        <div id= {checked ? aniStyle.mars_animode : menuStyle.mars_menumode}></div>
        <div id= {checked ? aniStyle.jupiter_animode : menuStyle.jupiter_menumode}></div>
        {checked ? <div id={aniStyle.saturn_animode}/>   : <div id={menuStyle.saturn_menumode}> <div id={menuStyle.saturn_bottom}/> <div id={menuStyle.saturn_ring}/> <div id={menuStyle.saturn_top}/></div>}
        <div id= {checked ? aniStyle.uranus_animode : menuStyle.uranus_menumode}></div>
        <div id= {checked ? aniStyle.neptune_animode : menuStyle.neptune_menumode}></div>


        <Offcanvas id={menuStyle.Offcanvas} show={show} onHide={handleClose} {...props}>
            <Offcanvas.Header className={menuStyle.Offcanvas_Header} closeButton closeVariant="white">
            </Offcanvas.Header>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>About Me</Offcanvas.Title>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Skills</Offcanvas.Title>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Projects</Offcanvas.Title>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Contact Me</Offcanvas.Title>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Education</Offcanvas.Title>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Others</Offcanvas.Title>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>1</Offcanvas.Title>
            <Offcanvas.Title className={menuStyle.Offcanvas_Title}>2</Offcanvas.Title>
        </Offcanvas>

    <Form>
      <Form.Check 
        type="switch"
        id="custom-switch"
        style={{"margin-left":"45%"}}
        checked={checked}
        label={checked ? "애니메이션 모드" : "메뉴 모드" }
        onChange={(e) => setChecked(e.currentTarget.checked)} 
      />

    </Form>

    </>

    );
};

export default Home;
